import logoImg from "../assets/translator.png";

import "../styles/header.css";

export function Header() {
  return (
    <div id='header'>
      <button className='link-home'>
        <img src={logoImg} alt='Logo To be' />
        <h2>to be</h2>
      </button>
      <div className='header-links'>
        <h3>Sobre</h3>
        <h3>Contato</h3>
      </div>
    </div>
  );
}
